import React from "react";

function LoginComponent() {
  return (
    <Container>
      <div className="row">
        <input type="text" name="name" placeholder="Enter Username" />
        <input type="password" name="name" placeholder="Enter Password" />
      </div>
    </Container>
  );
}

export default LoginComponent;
